svg.script:

function chang1_yes(id) {
    $("#tooth1"+id).css({'visibility': 'hidden'});
    if($("input[name ='Toothcase[tooth_1]']").val() == ''){
        $("input[name ='Toothcase[tooth_1]']").val(id);
    }else{
        $("input[name ='Toothcase[tooth_1]']").val($("input[name ='Toothcase[tooth_1]']").val() + ',' + id);
    }
}
function chang1_no(id) {
    $("#tooth1"+id).removeAttr("style");
    val = $("input[name ='Toothcase[tooth_1]']").val().split(",");
    for(var i=0; i<val.length; i++) {
        if(arr[i] == id) {
            val.splice(i, 1);
            break;
        }
    }
    $("input[name ='Toothcase[tooth_1]']").val(val.join(','));
}
